Jggg=="},"metadata":{"image/png":{"height":480,"width":720}},"output_type":"display_data"}],"source":["recipe_tree <- recipe(log_calories ~ ., data = train) %>%\n","  step_rm(id, Calories, yj_calories) %>%\n","\n","  # Feature engineering\n","  step_mutate(\n","    BMI = Weight / (Height / 100)^2,\n","    Temp_Deviation = Body_Temp - 37,\n","    HR_per_min = Heart_Rate / Duration,\n","    Temp_per_min = Body_Temp / Duration\n","  ) %>%\n","\n","  # Clean and transform engineered features\n","  step_mutate(\n","    BMI = pmax(BMI, 0),\n","    log_HR_per_min = log1p(HR_per_min),\n","    log_Temp_per_min = log1p(Temp_per_min)\n","  ) %>%\n","  step_rm(HR_per_min, Temp_per_min) %>%\n","\n","#step_interact(Duration:Weight) %>%\n","  step_mutate(\n","      log_HR_per_min = pmin(log_HR_per_min, quantile(log_HR_per_min, 0.99)),\n","      BMI = pmin(BMI, quantile(BMI, 0.99))\n","    ) %>%\n","  # Bin age into  4 life stages (custom cut)\n","  step_mutate(\n","    age_group = factor(case_when(\n","      Age <= 25 ~ \"young\",\n","      Age <= 45 ~ \"adult\",\n","      Age <= 65 ~ \"midlife\",\n","      TRUE      ~ \"senior\"\n","    ))\n","  ) %>%\n","  step_ns(Age, deg_free = 4) %>%\n","\n","  # One-hot encode categorical variables\n","  step_dummy(all_nominal_predictors()) \n","\n","\n","\n","\n","\n","recipe_tree %>% prep %>% juice %>% head\n","recipe_tree %>% prep %>% juice %>% plot_histogram(., position=\"identity\", alpha=0.5)"]},{"cell_type":"code","execution_count":null,"id":"3404760c","metadata":{"papermill":{"duration":0.02545,"end_time":"2025-05-03T09:29:37.236231","exception":false,"start_time":"2025-05-03T09:29:37.210781","status":"completed"},"tags":[]},"outputs":[],"source":[]},{"cell_type":"code","execution_count":16,"id":"37ee84e4","metadata":{"execution":{"iopub.execute_input":"2025-05-03T09:29:37.2902Z","iopub.status.busy":"2025-05-03T09:29:37.288442Z","iopub.status.idle":"2025-05-03T09:29:37.586832Z","shell.execute_reply":"2025-05-03T09:29:37.583884Z"},"pa